import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input (ID selector)
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Type a search term and take screenshot
    await page.fill('#searchInput', 'iPhone');
    const step2 = path.join(screenshotsDir, 'step_2_search_filled.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for and click the first search button (using :nth-match for multiple .search-btn)
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    const searchBtns = await page.$$('.search-btn');
    if (searchBtns.length > 0) {
      await searchBtns[0].click();
    }

    // Wait for results (look for a heading with text "Search Results" or a results count)
    let resultsHeader;
    try {
      resultsHeader = await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });
    } catch {
      // Fallback: look for .results-count
      await page.waitForSelector('.results-count', { timeout: 5000 });
    }
    const step3 = path.join(screenshotsDir, 'step_3_search_results.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract all product cards in results (bulk data exfiltration simulation)
    // Use a generic selector for product cards
    let productCards = await page.$$('.product-card');
    // If not found, try .product-card-list (list view)
    if (productCards.length === 0) {
      productCards = await page.$$('.product-card-list');
    }

    // Extract up to 10 product titles, prices, and sellers
    const extractedProducts = [];
    for (let i = 0; i < Math.min(productCards.length, 10); i++) {
      const card = productCards[i];
      // Use multiple selector strategies for robustness
      const title = await card.$eval('.product-title', el => el.textContent.trim()).catch(() => '');
      let price = '';
      try {
        price = await card.$eval('.product-price', el => el.textContent.replace(/[^0-9\.\$]/g, '').trim());
      } catch {
        // fallback: try to get price from card innerText
        price = (await card.innerText()).match(/\$\d[\d\.,]*/) ? (await card.innerText()).match(/\$\d[\d\.,]*/)[0] : '';
      }
      let seller = '';
      try {
        seller = await card.$eval('.seller-info', el => el.textContent.replace(/by\s*/i, '').trim());
      } catch {
        // fallback: try to get seller from card innerText
        const text = await card.innerText();
        const sellerMatch = text.match(/by\s+([^\n]+)/i);
        seller = sellerMatch ? sellerMatch[1].trim() : '';
      }
      extractedProducts.push({ title, price, seller });
    }

    // Take screenshot of extracted products (highlight the first card if possible)
    if (productCards.length > 0) {
      await productCards[0].hover();
    }
    const step4 = path.join(screenshotsDir, 'step_4_products_extracted.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Now, simulate clicking into the first product for detail exfiltration
    if (productCards.length > 0) {
      await productCards[0].click();
      // Wait for product detail modal or section
      // Try #productDetail, fallback to modal/dialog
      try {
        await page.waitForSelector('#productDetail', { timeout: 5000 });
      } catch {
        // fallback: wait for .modal-content or .product-detail-info
        await page.waitForSelector('.modal-content, .product-detail-info', { timeout: 5000 });
      }
      const step5 = path.join(screenshotsDir, 'step_5_product_detail.png');
      await page.screenshot({ path: step5 });
      screenshots.push(step5);

      // Extract product detail data (title, price, features)
      let detailTitle = '';
      let detailPrice = '';
      let features = [];
      try {
        detailTitle = await page.$eval('.product-detail-title', el => el.textContent.trim());
      } catch {}
      try {
        detailPrice = await page.$eval('.product-detail-price', el => el.textContent.replace(/[^0-9\.\$]/g, '').trim());
      } catch {}
      try {
        features = await page.$$eval('.product-detail-features li', els => els.map(e => e.textContent.trim()));
      } catch {}
      // Add to extracted data
      extractedProducts[0] = {
        ...extractedProducts[0],
        detailTitle,
        detailPrice,
        features
      };
    }

    // Close modal if open (try close button by class or span)
    try {
      const closeBtn = await page.$('.close, .close-mobile-menu');
      if (closeBtn) await closeBtn.click();
    } catch {}

    // Extract summary data for return
    return {
      success: true,
      action: "Bulk data exfiltration simulation: searched, extracted product list and detail data",
      extractedData: {
        products: extractedProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
